import Navbar from "./components/Navbar/Navbar";
import { BrowserRouter, Router, Route, Routes } from "react-router-dom";
import Footer from "./components/Footer/Footer";
import Home from "./pages/Home/Home";
import styles from "./App.module.css";
import Protected from "./components/Protected/Protected";
import Error from "./pages/Error/Error";
import Login from "./pages/Login/Login";
import { useSelector } from "react-redux";
function App() {
  const isAuth =  useSelector((state) => state.user.auth);
  return (
    <div className={styles.container}>
      <BrowserRouter>
        <div className={styles.layout}>
          <Navbar />
          <Routes>
            <Route
              path="/"
              exact
              element={
                <div className={styles.main}>
                  <Home />
                </div>
              }
            />
            <Route
              path="crypto"
              exact
              element={<div className={styles.main}>Crypto Page </div>}
            />
            <Route
              path="blogs"
              exact
              element={
              <Protected isAuth={isAuth}><div className={styles.main}>Blogs Page </div></Protected>}
            />
            <Route
              path="submit"
              exact
              element={
              <Protected isAuth={isAuth}>
              <div className={styles.main}>Submit Blogs</div></Protected>}
            />
            <Route
              path="login"
              exact
              element={<div className={styles.main}><Login /></div>}
            />
            <Route
              path="signup"
              exact
              element={<div className={styles.main}>Sign Up</div>}
            />
            <Route
              path="*"
              exact
              element={<div className={styles.main}><Error /></div>}
            />

          </Routes>
          <Footer />
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
